description:
Other Solar Systems

Science Documentary hosted by Sir Patrick Moore, published by BBC broadcasted as part of BBC The Sky at Night series in 2012 - English narration


Information
------------------------------

We now know there are other solar systems far away in space, but are they like ours and is there life on these strange worlds? Sir Patrick Moore goes on the quest for little green men.

